import React from 'react'

interface ButtonProps{
    digit:string,
    handleAddDigits?:(e:React.ChangeEvent<HTMLInputElement>)=> void,
    className?:string
}

const Button=({digit ,className ,handleAddDigits}:ButtonProps) => {
  return (
    <input className={className}  type="button" value={digit}  />
  )
}

export default Button
